import React from 'react';

import { View,StyleSheet,Text  } from 'react-native';



const HomeScreen = ()=>
{
    return(
        <View style={styles.Home}>
            <View style={styles.header} >
                <Text style={styles.HeaderText}> LIST OF OUR SALES </Text>
            </View>
            <View style={styles.container}>
                <View style={styles.ListItem}>
                   <View styles={styles.ListContent}>
                        <Text>Number: hiNumber: hi</Text>
                        <Text>client:hiNumber: hi</Text>
                        <Text>Total: Number: hi</Text>
                        <Text>Statuts:Number: hi </Text>
                   </View>
                </View>

                
            </View>
        </View>
    );
}
export default HomeScreen;

const styles = StyleSheet.create({
    Home:{
        flex:1,
        backgroundColor:'#CD4C51'
    },
    header:{
        flex:1,
        justifyContent:'flex-end',
        paddingBottom:30,
        paddingLeft:30
    },
    HeaderText:{
        color:'#FFF',
        fontSize:28,
        fontFamily:'monospace'
    },
    container:{
        flex:8,
        backgroundColor:'#FFF',
        borderTopLeftRadius:30,
        borderTopRightRadius:30,
    },
    ListItem:{
        flexDirection:'row',
        justifyContent:'center',
        marginVertical:20
    }

})
